function createUserdata(organizer, company, about, scheduledfor, duration, capacity) {
    return { organizer, company, about, scheduledfor, duration, capacity };
  }
  
const eventRows = [
    createUserdata('Cupcake', 'spectrum Global', 'Example event 1', '5-12-2019','2 hours', 5),
    createUserdata('Donut', 'spectrum Global', 'Example event 2', '5-12-2019', '2 hours', 12),
    createUserdata('Eclair', 'spectrum Global', 'Example event 3', '5-12-2019','5 hours', 6),
    createUserdata('Frozen yoghurt', 'spectrum Global', 'Example event 4', '5-12-2019','3 hours',3),
    createUserdata('Gingerbread', 'spectrum Global', 'Example event 5', '5-12-2019','4 hours',4),
    createUserdata('Honeycomb', 'spectrum Global', 'Example event 6', '5-12-2019','5 hours',5),
    createUserdata('Ice cream sandwich', 'spectrum Global', 'Example event 7', '5-12-2019','2 hours',7),
    createUserdata('Jelly Bean', 'spectrum Global', 'Example event 8', '5-12-2019','5 hours',8),
    createUserdata('KitKat', 'spectrum Global', 'Example event 9', '5-12-2019','5 hours',9),
    createUserdata('Lollipop', 'spectrum Global', 'Example event 10', '5-12-2019','5 hours',6),
    createUserdata('Marshmallow', 'spectrum Global','Example event 11', '5-12-2019','5 hours',4),
    createUserdata('Nougat', 'spectrum Global', 'Example event 12', '5-12-2019','5 hours',3),
    createUserdata('Oreo', 'spectrum Global', 'Example event 13', '5-12-2019','5 hours', 2),
  ];

export const eventColumns = [
    { key_id: 'organizer', numeric: false, disablePadding: true, label: 'Organizer', sortFlag:true },
    { key_id: 'company',  numeric: false, disablePadding: false, label: 'Company', sortFlag:true },
    { key_id: 'about', numeric: false, disablePadding: false, label: 'About', sortFlag:false },
    { key_id: 'scheduledfor', numeric: false, disablePadding: false, label: 'Scheduled For', sortFlag:false },
    { key_id: 'duration', numeric: false, disablePadding: false, label: 'Duration', sortFlag:false },
    { key_id: 'capacity', numeric: true, disablePadding: false, label: 'Capacity', sortFlag:true}
  ];

  export default eventRows;
